module.exports.getAllUlbs = async function (req, res) {
  try {
    // Get all ulbs list in older format, so that everything works fine
    let data;
    Redis.get("ulbList", async (err, value) => {
      // console.log(err, value);
      if (!value) {
        data = await Ulb.aggregate([
          {
            $lookup: {
              from: "states",
              localField: "state",
              foreignField: "_id",
              as: "state",
            },
          },
          { $unwind: "$state" },
          {
            $lookup: {
              from: "ulbtypes",
              localField: "ulbType",
              foreignField: "_id",
              as: "ulbType",
            },
          },
          { $unwind: "$ulbType" },
          {
            $group: {
              _id: "$state.code",
              state: { $first: "$state.name" },
              state_id: { $first: "$state._id" },
              ulbs: {
                $push: {
                  _id: "$_id",
                  state: "$state.name",
                  code: "$code",
                  name: "$name",
                  natureOfUlb: "$natureOfUlb",
                  type: "$ulbType.name",
                  ward: "$ward",
                  area: "$area",
                  population: "$population",
                  amrut: "$amrut",
                  location: "$location",
                },
              },
            },
          },
          {
            $project: {
              _id: 0,
              stateCode: "$_id",
              ulbs: 1,
              state: 1,
              state_id: 1,
            },
          },
        ]).exec();
        Redis.set("ulbList", JSON.stringify(data));
      } else {
        data = JSON.parse(value);
      }
      if (data.length) {
        let obj = {};
        for (let el of data) {
          obj[el.stateCode] = {
            state: el.state,
            ulbs: el.ulbs,
            _id: el.state_id,
          };
        }
        return res
          .status(200)
          .send({ success: true, data: obj, msg: "ULBS Found" });
      } else {
        return res
          .status(200)
          .send({ success: true, data: {}, msg: "No ULBS Found" });
      }
    });
  } catch (e) {
    console.log("Erro", e);
    return {};
  }
};

// Get all ledgers present in database in CSV Format
module.exports.getAllULBSCSV = function (req, res) {
  let filename = "All Ulbs " + moment().format("DD-MMM-YY HH:MM:SS") + ".csv";

  // Set approrpiate download headers
  res.setHeader("Content-disposition", "attachment; filename=" + filename);
  res.writeHead(200, { "Content-Type": "text/csv;charset=utf-8,%EF%BB%BF" });
  
  res.write(
    "ULB Name, City Finance Code,Census Code, Swatcha Bharat Code, ULB Type, State Name, State Code, Nature of ULB, Area, Ward, Population, AMRUT, Latitude,Longitude,isMillionPlus, UA, UA_code, Created On, Modified On \r\n"
  );
  // Flush the headers before we start pushing the CSV content
  res.flushHeaders();

  Ulb.aggregate([
    {
      $lookup: {
        from: "states",
        as: "states",
        foreignField: "_id",
        localField: "state",
      },
    },
    {
      $lookup: {
        from: "ulbtypes",
        as: "ulbtypes",
        foreignField: "_id",
        localField: "ulbType",
      },
    },
    {
      $lookup: {
        from: "uas",
        as: "UA_Data",
        foreignField: "_id",
        localField: "UA",
      },
    },

    {
      $project: {
        ulbs: { $arrayElemAt: ["$ulbs", 0] },
        states: { $arrayElemAt: ["$states", 0] },
        ulbtypes: { $arrayElemAt: ["$ulbtypes", 0] },
        UA: { $arrayElemAt: ["$UA_Data", 0] },
        natureOfUlb: 1,
        lineitems: { $arrayElemAt: ["$lineitems", 0] },
        financialYear: "$financialYear",
        area: 1,
        population: 1,
        amrut: 1,
        name: 1,
        code: 1,
        wards: 1,
        location: 1,
        createdAt: 1,
        modifiedAt: 1,
        isMillionPlus: 1,
        censusCode: 1,
        sbCode: 1,
      },
    },
    {
      $project: {
        _id: 0,
        ulb: { $cond: ["$ulbs", "$ulbs", "NA"] },
        state: { $cond: ["$states", "$states", "NA"] },
        ulbtypes: { $cond: ["$ulbtypes", "$ulbtypes", "NA"] },
        financialYear: 1,
        natureOfUlb: 1,
        area: 1,
        population: 1,
        amrut: 1,
        name: 1,
        code: 1,
        wards: 1,
        location: 1,
        isMillionPlus: 1,
        createdAt: 1,
        modifiedAt: 1,
        censusCode: { $cond: ["$censusCode", "$censusCode", "NA"] },
        sbCode: { $cond: ["$sbCode", "$sbCode", "NA"] },
        UA: { $cond: ["$UA", "$UA.name", "NA"] },
        UA_Code: { $cond: ["$UA", "$UA.UACode", "NA"] },
      },
    },
  ]).exec((err, data) => {
    if (err) {
      res.json({
        success: false,
        msg: "Invalid Payload",
        data: err.toString(),
      });
    } else {
      for (let el of data) {
        el.natureOfUlb = el.natureOfUlb ? el.natureOfUlb : "";
        el.name = el.name ? el.name.toString().replace(/[,]/g, " | ") : "";
        el.location = el.location ? el.location : { lat: "NA", lng: "NA" };
        res.write(
          el.name +
            "," +
            el.code +
            "," +
            el.censusCode +
            "," +
            el.sbCode +
            "," +
            el.ulbtypes.name +
            "," +
            el.state.name +
            "," +
            el.state.code +
            "," +
            el.natureOfUlb +
            "," +
            el.area +
            "," +
            el.wards +
            "," +
            el.population +
            "," +
            el.amrut +
            "," +
            el.location.lat +
            "," +
            el.location.lng +
            "," +
            el.isMillionPlus +
            "," +
            el.UA +
            "," +
            el.UA_Code +
            "," +
            el.createdAt +
            "," +
            el.modifiedAt +
            "\r\n"
        );
      }
      res.end();
    }
  });
};

