const getUlbs = (yrs) => {
  return new Promise(async (resolve, reject) => {
    let years = yrs ? yrs.sort() : [];
    let ulbs = [];
    try {
      for (let i = 0; i < years.length; i++) {
        let year = years[i];
        let query = { financialYear: year };
        if (i > 0) {
          query["ulb"] = { $in: ulbs };
        }
        ulbs = await UlbLedger.distinct("ulb", query).exec();
      }
      resolve(ulbs);
    } catch (e) {
      console.log(e);
      reject(e);
    }
  });
};

